import CourseForm from './CourseForm';

function AdminDashboard({ onCourseAdded }) {
  return (
    <div>
      <h2>Yeni Kurs Ekle</h2>
      <CourseForm onCourseAdded={onCourseAdded} />
    </div>
  );
}

export default AdminDashboard;
